import React, { useEffect, useState } from 'react'

const Home = () => {
    const [items, setItems] = useState([])
    useEffect(() => {
        fetch('http://localhost:3001/products')
            .then(response => response.json())
            .then(data => console.log(data))
    }, [])
    return (
        <div>
            Home
        </div>
    )
}

export default Home
